import React, { Component } from 'react';
import { Container, Jumbotron, Button } from 'react-bootstrap';

class Login extends Component {

  render() {
    return (
      <Container>
        <Jumbotron>
          <h1>Login</h1>
          <Button onClick={this.props.changeLogin}> {this.props.isLoggedIn ? "Logout" : "Login" } </Button>
        </Jumbotron>
      </Container>
    )
  }
}

export default Login;
